    "2009-puget-sound-lidar-consortium-pslc-topographic-lidar-san-juan-county-and-lummi-island-washi",nt"isopen":
    false,nt"url": null,nt"notes": "The dataset encompasses portions of San
    Juan and Whatcom counties in northwest Washington. The surveyed area is approximately
    222 square miles. The LAS V1.1 files are classified into Class 1 (Unclassified)
    and Class 2 (Bare Earth) water points are included in both classes. The LAS files
    are all-return and also include intensity measurements. 50% overlap was used between
    flightines, resulting in each area being surveyed twice. The nominal point spacing
    of the data is 0.408 meters (6 pt/sq. meter). Watershed Sciences, Inc. collected
    the LiDAR and created this data set for the Puget Sound LiDAR Consortium",nt"license_title":
